INSERT INTO `posts` (`id`, `name`, `content`, `creation_date`) VALUES
(1, 'Denis', 'Aujourd''hui, mon frère arrive à fond dans la salle à manger et demande à ma mère : "Maman, 24h c''est un ou deux jours ?" Dylan, 17 ans. JDC', '2015-02-20 17:00:41'),
(2, 'Toto', 'Aujourd''hui, mon fils de 3 ans m''a réveillée soudainement en pleine nuit en pleurant. Paniquée, j''ai couru jusqu''à sa chambre. La raison de ce hurlement ? "Mais moi je veux pas de sourciiiiiiiils !" JDC', '2015-02-20 17:13:26'),
(3, 'Bobby', 'Aujourd''hui, j''annonce à ma fille de 11 ans qu''il neige. Sa réponse : "Tu l''as su par Facebook ?" Euh non, on a aussi des fenêtres chez nous. JDC', '2015-02-20 17:13:43'),
(4, 'John', 'Aujourd''hui, alors que j''explique à ma grand mère avoir enfin trouvé ma robe de mariée, celle-ci m''a gentiment répondu : "De toute façon avec toi, on s''attend à tout. Ton mariage sera pire qu''un carnaval." JDC', '2015-02-20 17:35:07'),
(5, 'Brad', 'Aujourd''hui, mon fils ouvre le frigo, farfouille quelques minutes et referme la porte, contrarié. "Papa, y''a que des œufs normaux, t''as oublié d''acheter des œufs durs !" Florian, 14 ans. JDC', '2015-02-20 17:35:30'),
